window.bookSummaryJSON = "<p>The world of the Blackthorne vampires is wide, and their history spans centuries. From the dark past of the Salem witch trials, to modern-day fated mates, the stories told by Blackthornes are filled with intrigue and romance to tragedy and destiny. </p> <p>Vampires all connected to the Blackthorne dynasty, Silas, Mattias, and Brandt are ready to tell their tales.</p> <p>Narrated in duet by Kai Kennicott and Wen Ross as well as Aaron Shedlock and Kylie Stewart, these three stories are also available separately as <i>Wicked Thorne</i>, <i>Forever Claimed</i>, and <i>Immortal Promise</i>.</p>"; 
